%[text] # SVD
clc; close all; clearvars

% load the data
load("Indian_pines.mat");

[row, col, d] = size(indian_pines);

% wavelength vector (400-2500nm)
wavelengths = linspace(400, 2500, d);

R = 633;
G = 532;
B = 450;

% RGB visualization
hcube = imhypercube(indian_pines, wavelengths);
rgbImage = colorize(hcube, "Method", "rgb", "ContrastStretching", true);
figure; imshow(rgbImage); %[output:322c05d0]

% one band visualized
band = 48;
figure; %[output:9e951dc8]
imagesc(indian_pines(:,:,band)); %[output:9e951dc8]
colormap('jet'); colorbar; %[output:9e951dc8]
title("Visualization of band " + string(band)); %[output:9e951dc8]

% spectra of the selected pixel
figure;  %[output:8a4cdc1c]
plot(wavelengths, squeeze(indian_pines(46,89,:))); %[output:8a4cdc1c]
hold on; %[output:8a4cdc1c]
xlabel("Wavelength [nm]"); %[output:8a4cdc1c]
ylabel("Reflectance"); %[output:8a4cdc1c]

% number of cells needed to store the data
no_cells = numel(indian_pines);

% reshape cube into 2D matrix
spectra2D    = reshape(indian_pines, [], d, 1);

% SVD
% [U, S, V] = svd(spectra2D, "econ");

%SVD after normalization
[spectra2Dsc, muX, stdX] = zscore(spectra2D);
[U2, S2, V2] = svd(zscore(spectra2Dsc), "econ");

figure;  %[output:6630d37b]
nexttile;  %[output:6630d37b]
bar(diag(S2)); %[output:6630d37b]
xlabel("Singular vector number"); %[output:6630d37b]
ylabel("Singular value"); %[output:6630d37b]

% Variance
nexttile; %[output:6630d37b]
plot(cumsum(diag(S2.^2))/sum(diag(S2.^2))); %[output:6630d37b]
ylabel("Cumulative Variance") %[output:6630d37b]
xlabel("Singular Vector number") %[output:6630d37b]
% I chose as a reconstuction rank = 27, because cumulative variance > 0.95
% cumsum(diag(S2.^2))/sum(diag(S2.^2));
r_rank = 27;
U_r = U2(:,1:r_rank);
S_r = S2(1:r_rank,1:r_rank);
V_r = V2(:,1:r_rank)';
% Truncated matrix
reconstr  = U_r * S_r * V_r;

elements_orig = (numel(U2*S2) + numel(V2));

% number of elements in U*S + number of elements in V
elements_new = (numel(U_r*S_r) + numel(V_r));

% how many percents has the data simension reduced:
reducion_per = (elements_orig-elements_new)/elements_orig*100 %[output:3da7746c]

% RMSE
rmseR2 = (spectra2Dsc-reconstr).^2;

% rmseR2 dimensions 145x145x220, with means I get 145x145 which has only
% errors
rmseR2 = mean(reshape(rmseR2, row, col, d),3);

% false color image of the reconstruction error
figure; %[output:6b9c8a2e]
imagesc(rmseR2); %[output:6b9c8a2e]
colormap('jet'); colorbar; %[output:6b9c8a2e]

% errors seem to be systematically located in areas where the original
% image has more detail, contrast, or unusual features (e.g., field
% boundaries, roads, shadows) or individual 'noise pixels'.

